describe("_-like filter",function(){it("should filter arrays",function(){var e=[1,2,3,4,5],t=filter(e
,function(e){return e>2});expect(t.length).toBe(3),expect(t).toEqual([3,4,5])}),it("should filter objects"
,function(){var e={foo:1,bar:2,baz:3,qux:4},t=filter(e,function(e,t){return e>2});expect(Object.keys(
t).length).toBe(2),expect(t).toEqual({baz:3,qux:4})})});